def words_in_sentence(sentence):
    new_lst = []
    for word in sentence.split():
        if len(word) == 1:
            continue  # Skip single-character words
        flg = 0
        for i in range(2, len(word)):
            if len(word) % i == 0:
                flg = 1
                break  # No need to check further
        if flg == 0 or len(word) == 2:
            new_lst.append(word)
    return " ".join(new_lst)

def digits_sum(n):
    if n < 0:
        return sum(int(c) for c in str(n))
    else:
        return sum(int(c) for c in str(n))

def order_by_points(nums):
    return sorted(nums, key=digits_sum)

def maximum(arr, k):
    arr.sort()
    return arr[-k:]

def add_elements(arr, n):
    total = 0
    for i in range(n):
        if len(str(arr[i])) <= 2:
            total += arr[i]
    return total

def solution(lst):
    total = 0
    for idx, val in enumerate(lst):
        if idx % 2 == 1 and val % 2 == 1:
            total += val
    return total

def filter_integers(values):
    out = [x for x in values if isinstance(x, int)]
    return out

def greatest_common_divisor(a, b):
    while b:
        a, b = b, a % b
    return a
